package LeetCode75.SlidingWindow;

import java.util.ArrayList;

public class MaximumNumberOfVowelsInASubstringOfGivenLength {
    public static int maxVowels(String s, int k) {
        int maxVowelCountInSubstring = 0;
        ArrayList<Character> vowels = new ArrayList<>();
        vowels.add('a');
        vowels.add('e');
        vowels.add('i');
        vowels.add('o');
        vowels.add('u');

        for (int i = 0; i < s.length()-k+1; ++i) {
            String substring = s.substring(i, i + k);
            int count = countTargetCharacters(substring, vowels);
            maxVowelCountInSubstring = Math.max(maxVowelCountInSubstring, count);
        }

        return maxVowelCountInSubstring;
    }

    public static int countTargetCharacters(String s, ArrayList<Character> l) {
        int count = 0;
        for (int i = 0; i < s.length(); ++i) {
            if (l.contains(s.charAt(i))) count++;
        }

        return count;
    }

    public static void main(String[] args) {
//        System.out.println(maxVowels("abciiidef", 3));
//        System.out.println(maxVowels("leetcode", 3));
        System.out.println(maxVowels("weallloveyou", 7));
//        String s = "";
//        System.out.println(maxVowels(s, 3945));
    }
}
